import React, { useState, useEffect } from "react";
// css
import { AccountIcon, ErrorIcon } from "mdi-react";
// components 
import Warning from "./ui/Warning";
import TextInput from "./ui/TextInput";
import TextArea from "./ui/TextArea";
import FormButton from "./ui/FormButton";

const Login = props => {
    const [loginName, setLoginName] = useState();
    const [loginPassword, setLoginPassword] = useState();
    const [valTxtName, setValTxtName] = useState();
    const [valTxtPassword, setValTxtPassword] = useState();
   
    const handleFormChange = () => {}

    const handleSubmitLogin = () => {}

    return <>
       <form>
            <h1>Log ind</h1>
            <h2>Brugernavn</h2>
            <TextInput
            name="loginName"
            value={loginName}
            handleChange={handleFormChange}
            initText="Brugernavn"
            />
            <Warning validationText={valTxtName}/>              
            <h2>Kodeord</h2>
            <TextInput
            name="loginPassword"
            value={loginPassword}
            handleChange={handleFormChange}
            initText="Kodeord"
            />
            <Warning validationText={valTxtPassword}/>
            <FormButton
            label="log ind"
            iconLeft={<AccountIcon/>}
            style={{ marginTop: "1rem" }}
            handleSubmit={handleSubmitLogin}
            />

            {props.errorMessageAuthentication && (
            <p className="error-message">
                <ErrorIcon />
                {props.errorMessageAuthentication}
                {props.unsetErrorMessageLogIn()}
            </p>
            )}
        </form>
    </> 
}

export default Login;
